import React , { useState } from 'react'


export default function Calculator(props) {
    const [inp1, setInp1]=useState(0|| '')
    const [inp2, setInp2]=useState(0|| '')

    return (
        <div className="section calc">
            <p className="fs-14">Calculator:</p>
            <label>{props.symbol}:</label><input value={inp1} onChange={e => setInp1(e.target.inp1)} className="tokeninp m-b-15"></input>
            <br/>
            <label>USD:</label><input value={inp2} onChange={e => setInp2(e.target.inp2)} className="tokeninp"></input>
        </div>
    )
}
